import React from 'react';
import logo from './assets/logo.svg';
import './App.css';

function App() {

  var title = "Copter"

  return (
    <div className="App">
        <table className="NavBar">
          <tbody>
            <tr>
              <td><img src={require('./assets/logo.svg')} width="50"></img></td>
              <td style={ {cursor : PointerEvent} }>Learn React by K.Copter</td>
            </tr>
          </tbody>
        </table>
        <input style={{fontSize:24,width:'100%'}} placeholder="Please enter what do you want." onKeyUp={ (event) => {console.log(event.target.value)}}></input>
    </div>
  );
}

export default App;
